import debounce from 'lodash.debounce'
import Icon from './Icon.vue'

export default {
  name: 'PostsFilterSearch',

  components: {
    Icon,
  },

  props: {
    value: {
      type: String,
      required: true,
    },
  },

  computed: {
    updateValue () {
      return debounce(e => {
        this.$emit('input', e.target.value)
      }, 300)
    },
  },
}
